import React from 'react';
import {View, Text, TouchableOpacity, StyleSheet, Image} from "react-native";

export default function Gerenciar_doac({navigation}){
return (
    <View style={styles.container}>
      <StatusBar hidden={true}></StatusBar>
      
        <Text style={styles.titulo}>Gerenciar Pets</Text>

        <View style={styles.areaBtn}>
          
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Cadastrar Doações')}
          >
            <Image
            source={require('../../assets/img_cadProt.png')}
            style={styles.image}
            />
            <Text style={styles.botaoText}>Cadastrar{"\n"}Doações</Text>
          </TouchableOpacity>
        </View>

        <View style={styles.areaBtn}>
          
          <TouchableOpacity
            style={[styles.botao, { backgroundColor: "#4F7063" }]}
            onPress={ () => navigation.navigate('Listar Doações')}
          >
            <Image
            source={require('../../assets/lupa.png')}
            style={styles.image}
            />
            <Text style={styles.botaoText}>Visualizar{"\n"}Doações</Text>
          </TouchableOpacity>
        </View>


        <View style={{backgroundColor: "#4F7063", height: '10%', width:'100%'}}></View>
    </View>
)
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: "space-between",

    },
    titulo:{
      backgroundColor: "#4F7063",
      fontSize: 50,
      height: '15%',
      textAlignVertical:'center',
    },
    areaBtn: {
      alignItems: "center",
      justifyContent: "center",
    },
    botao: {
      height: 127,
      padding: 15,
      borderRadius: 30,
      width:'80%',
      flexDirection: "row",
      justifyContent: 'space-between',
      alignItems: "center",
    },
    botaoText: {
      textAlign: 'left',
      fontSize: 27,
      color: "#000",
      fontWeight: "bold",
    },
    image: {
      width:90,
      height:90,
    }
  });
